import React,{useState,useEffect} from "react";
import Card from "./Card";
import './style.css';


const Nav = ()=>{
    const APP_ID = "cf4c7b09";
    const APP_KEY = "363f3931b7374ce8ec4f6e2367cf76ab"
    const req = `https://api.edamam.com/search?q=chicken&app_id=${APP_ID}&app_key=${APP_KEY}`

    const [recipes, setRecipes] = useState([])
    
    const getRecipes = async ()=>{
        const response = await fetch(req);
        const data = await response.json();
        setRecipes(data.hits);
        console.log(data.hits);
    };

    useEffect(() => {
        getRecipes();
    },[]);


    return(
        <div className="container">
            <input className="inputField" type={'text'}/>
            <button className="btn btn-primary btnClass">Search</button>
            {recipes.map(recipe =>{
                return (<Card title ={recipe.recipe.label} calories = {recipe.recipe.calories} 
                image = {recipe.recipe.image} />)
            })}
        </div>     
    );
}

export default Nav;
